import React, { Component } from 'react';
import { Carousel} from 'react-bootstrap';
import '../App.css'
class Dashboard extends Component {
  render() {
    return (
        // <h1>Dashboard</h1>
        <div className='bg-container-layout'>
            <Carousel>
                <Carousel.Item>
                    <img width='100%' src="https://m-images.hooq.tv/resizer/resizer?service=singtel&surl=https://hooq-sanctuary.s3.amazonaws.com/assets/catalogs/SPOTLIGHT/c989cef654f6.jpg?&width=2500&height=977&scalingMode=aspectFill" />
                    <Carousel.Caption>
                    <h3>First slide label</h3>
                    <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img width='100%' src="https://m-images.hooq.tv/resizer/resizer?service=singtel&surl=https://hooq-sanctuary.s3.amazonaws.com/assets/catalogs/SPOTLIGHT/c989cef654f6.jpg?&width=2500&height=977&scalingMode=aspectFill" />
                    <Carousel.Caption>
                    <h3>Second slide label</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img width='100%' src="https://m-images.hooq.tv/resizer/resizer?service=singtel&surl=https://hooq-sanctuary.s3.amazonaws.com/assets/catalogs/SPOTLIGHT/c989cef654f6.jpg?&width=2500&height=977&scalingMode=aspectFill" />
                    <Carousel.Caption>
                    <h3>Third slide label</h3>
                    <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                </Carousel>;
        </div>
    );
  }
}

export default Dashboard;
